import React from 'react';

const LetterSpacing = () => {
  const letterSpacings = [
    { id: 101, classTitle: 'Default', classValue: 'lsDefault' },
    { id: 101, classTitle: 'Small', classValue: 'lsSM' },
    { id: 102, classTitle: 'Medium', classValue: 'lsMD' },
    { id: 103, classTitle: 'Large', classValue: 'lsLG' },
  ];

  return (
    <>
      <div className='containerFluid1 container1-lg'>
        <div className='sectionTitle pb2'>
          <h5 className='fontStyled fsH5 primary'>Letter Spacing</h5>
        </div>

        <div className='row pb1 fontStyled primary'>
          <div className='col3 classTitle'>
            <h6 className='fsH6'>Classes Names</h6>
          </div>
          <div className='col-9 classValue'>
            <h6 className='fsH6'>Appearance</h6>
          </div>
        </div>

        {letterSpacings.map((ls) => (
          <div className='row alignCenter mb1'>
            <div className='col6 col4-xs col3-sm fwBold'>
              <p className='fsSM'>.{ls.classValue}:</p>
            </div>

            <div className='col6 col8-xs col9-sm'>
              <div className='displayFlex alignEnd'>
                <div className='displayFlex'>
                  <h1 className={`fsH5 fontDefault ${ls.classValue}`}>
                    {ls.classTitle}
                  </h1>
                </div>
              </div>
            </div>
          </div>
        ))}
      </div>
    </>
  );
};

export default LetterSpacing;
